(()=>{function o(e){e.directive("page",a=>{let t=e.$data(a),n="scope-"+Date.now()+"-"+Math.floor(Math.random()*1e3);if(!t||typeof t.page!="function")throw new Error("Alpine data must have a 'page' function");typeof t.styles=="function"&&e.effect(()=>{a.innerHTML+=`
        <style>
          [data-scope="${n}"] {
            ${t.styles()}
          }
        </style>
        `}),e.effect(()=>{a.innerHTML+=`
      <div data-scope="${n}">
        ${t.page()}
      </div>
      `})})}document.addEventListener("alpine:init",()=>window.Alpine.plugin(o));})();
